import React, { useState, useEffect } from "react"

export const ConditionChecking = () => {
    const [status, setstatus] = useState(2)
    useEffect(() => {
        if (status === 1) {
            console.log(x, y, "1st console")
            var x = 10;
            var y = 20;
            console.log(x, y, "2nd console")
            function getRes() {
                console.log(x, y, "3rd console")
                x = 20;
                var y = 10;
                console.log(x, y, "4th console")
            }
            getRes()
        }
        else if (status === 2) {
            console.log(1 === "1", `1==="1", console 1`)
            console.log(1 == "1", `1=="1", console 2`)
            console.log(null == undefined, "null==undefined , console 3")
            console.log(null === undefined, "null===undefined, console 4")
            console.log({ a: 2 } == 2, "{a:2}==2, console 5")
            console.log({ a: 2 } === 2, "{a:2}===2, console 6")
            console.log({ a: 2 } == "2", `{a:2}=="2", console 7`)
            console.log({ a: 2 } === "2", `{a:2}==="2", console 8`)
            console.log({ a: 2 } == [{a: 2}], `{a:2}==[{a: 2}], console 9`)
            console.log({ a: 2 } === [{a: 2}], `{a:2}===[{a: 2}], console 10`)
            console.log({ a: 2 } == { a: 2 }, `{a:2}=={ a: 2 }, console 11`)
            varconsole.log({ a: 2 } === { a: 2 }, `{a:2}==={ a: 2 }, console 12`)
            console.log({ a: 2 } === "2", `{a:2}==="2", console 13`)
            console.log({ a: 2 } === "2", `{a:2}==="2", console 14`)
        }
    }, [])

    return (
        <div>
            kumar Madhu
            Condition Checking
        </div>
    )
}
